import React, { Component } from "react";
const Filter = ({ launch_year }) => {
  return (
    <div className="border bg-light p-2 ">
      <h2>Filters</h2>
      {launch_year.map((year) => (
        <button className="btn-lg btn-primary m-1">{year}</button>
      ))}
    </div>
  );
};

export default Filter;
